import React from 'react';
import ReactDom from 'react-dom';

var date = new Date(2020, 10, 3, 14);
var cssStyle = {};
if(date.getHours() < 12){
  var strTime = 'Morning';
}else if(date.getHours() > 12 && date.getHours() < 20 ){
  var strTime = 'Afternoon';
}else {
  var strTime = 'Evening';
}
ReactDom.render(
  <>
  <h1>Hello Sir, <span style="color:green">Good {strTime}</span>
  </h1>
  </>
  ,
  document.getElementById('root')
)
